    return (
    <nav>
        <ul>
            <li className="icon">icon</li>
            <li className="helper"></li>
            <li className="helper"></li>
        </ul>
        <div className="exit">
            <Link>exit</Link>
        </div>
        
    </nav>
)};

export default Hat;
